Merge pull request #472 from framasoft/add-scrollbar-to-multisheet-buttons

[MultiSheet] Show scroll bar on sheets navbar when needed

@audreyt  npm has not been updated in a while. 
I have not tested this.

@ldidry many thanks.

* Fix first-time calls for the following routes:

      /_/{id}
      /_/{id}/cells
      /_/{id}/cells/{coord}

  Closes #111.

* Update to Zappa 0.4, now that Express3 is finally out.

  This should fix #16 (needs verification).

  Also it looks like --basepath is no longer needed for #15;
  @redirect is handling https correctly.

Revert "* Put "volatile" in quotes to make closure compiler happier."

This reverts commit 3324ee76b76ff09f14b1f7fc72f4bb6a003d3fed.

@Nami-Doc++ pointed out it was unecessary without proper closure flags.
